import React from "react";
import "../../shared/UI/css/OrganizationsAndSubjects.css";

const styleCreateOrganization = {
  display: "flex",
  flexDirection: "column",
  padding: "10px 15px",
  width: "100%",
  justifyContent: "center",
  alignItem: "center",
};

const CreateOrganization = () => {
  return (
    <div className="create-organization" style={styleCreateOrganization}>
      <input type="text" placeholder="Oraganization name" />
      <input type="text" placeholder="Subject 1" />
      <input type="text" placeholder="Subject 2" />
      <button>+</button>
      <input type="text" placeholder="Admin name" />
      <button>Create</button>
    </div>
  );
};

export default CreateOrganization;
